<?phpnamespace Nemundo\Meteoschweiz\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractUninstall;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Meteoschweiz\Application\MeteoschweizApplication;use Nemundo\Meteoschweiz\Content\MeteoschweizContentTypeCollection;use Nemundo\Meteoschweiz\Content\Station\StationContentType;use Nemundo\Meteoschweiz\Content\WindChart\WindChartContentType;use Nemundo\Meteoschweiz\Data\MeteoschweizModelCollection;use Nemundo\Meteoschweiz\Scheduler\MesswertScheduler;use Nemundo\Meteoschweiz\Script\MeteoschweizCleanScript;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;class MeteoschweizUninstall extends AbstractUninstall{    public function uninstall()    {        (new SchedulerSetup(new MeteoschweizApplication()))            ->removeScheduler(new MesswertScheduler());        (new ContentTypeSetup(new MeteoschweizApplication()))            ->removeContentTypeCollection(new MeteoschweizContentTypeCollection() );            //->removeContentType(new WindChartContentType())            //->removeContentType(new TemperatureDifferenceContentType());        (new ModelCollectionSetup())            ->removeCollection(new MeteoschweizModelCollection());    }}